export default class Student extends Component {
    constructor(){}
    state = {
        roll:101
    }
    render() {
        return (
            <div>
                <h1>Name : {this.props.name}</h1>
                <h1>Roll : {this.state.roll}</h1>
            </div>
        )
    }
}
